# given a long target string s and a small number of pairs of short sequences, for all pairs, determine whether
# a contiguous but disjoint supersequence exists as a substring in s.

def solution(inpt):

    def canInterleave(s, t, u) -> bool:
        # print(s, t, u)
        if s == "":
            return True
        if not t:
            return s == u
        if not u:
            return s == t
        if s[0] != t[0] and s[0] != u[0]:
            return False
        if s[0] == t[0] and s[0] == u[0]:
            return canInterleave(s[1:], t[1:], u) or canInterleave(s[1:], t, u[1:])
        if s[0] == t[0]:
            return canInterleave(s[1:], t[1:], u)
        if s[0] == u[0]:
            return canInterleave(s[1:], t, u[1:])
        

    inpt = inpt.splitlines()
    s = inpt[0]
    patterns = inpt[1:]
    numPatterns = len(patterns)
    matrix = [[None] * numPatterns for _ in range(numPatterns)]
    for i in range(numPatterns):
        for j in range(numPatterns):
            if matrix[j][i] is not None:
                matrix[i][j] = matrix[j][i]
                continue
            t = patterns[i]
            u = patterns[j]
            # print("t, u:", t, u)
            length = len(t) + len(u)
            for k in range(0, len(s) - length + 1):
                window = s[k:k + length]
                # print(window)
                if canInterleave(window, t, u):
                    matrix[i][j] = 1
                    break
                matrix[i][j] = 0
    for row in matrix:
        print(*row)


solution('''
AAC
CACTCATA
GCATAC
CACTGCG
GCACAGT
CGGACTAGG
AGC
TCTCAT
CGTGGTGT
CATGT''')

    
    